import React from 'react';
import styled from 'styled-components';

import '../App.css';
const Divcon = styled.div
`
display: flex;
justify-content: center;
flex-direction: row;
flex-wrap: wrap;

`
const A=styled.a
`
text-decoration: none;
`



class UMAN extends React.Component{
  render() 
  {
    return (
      <>
      
            <a href="http://localhost:3000/admin"><button>Back to admin page</button></a>

      </>
      
    )

      

  }
}  
export default UMAN;


